webpackJsonp([0x6e84b85b1415],{8258:function(e,t){e.exports={data:{post:{html:"<p>My gmail address is fairly generic, and apparently there are other people who would like to be PapaScott but can't. So I get a fair amount of mail intended for other PapaScotts, including:</p>\n<ul>\n<li>confirmation for my tee time at a golf club in Pennsylvania</li>\n<li>notice of automatic deposit of my salary from the State of Tennessee</li>\n<li>my reservation for one week at a mobile home park in Georgia</li>\n<li>advertising from a car dealer in Argentina</li>\n<li>an appeal in French to donate (or sell, I can't tell) my blood plasma to a clinic in Paris</li>\n<li>invitation of regular lunches of ex-military folks in Tennessee</li>\n<li>regular notices of transactions (with scans of receipts) from my Well Fargo bank account in Georgia</li>\n</ul>\n<p>And I'm not even looking in my spam folder. I have enough keeping track of my own schedule without having to worry items for total strangers!</p>",fields:{title:"Tee Time For Two",date:"12 Aug 2017",url:"https://papascott.de/2017-08-12-tee-time-for-two/"}}},pathContext:{slug:"/2017-08-12-tee-time-for-two/",prev:{fields:{title:"Travis CI",date:"23 Jul 2017",slug:"/2017-07-23-travis-ci/"}},next:{fields:{title:"Katchi",date:"04 Jan 2018",slug:"/2018-01-04-katchi/"}}}}}});
